import Link from "next/link";
import React, { Component } from "react";

class Category_Item extends React.Component {
  render() {
    return (
      <div>
        <div>
          <a class="cardlink" href>
            <div class="cardwrapper">
              <div class="cardimagediv">
                <img
                  class="cardimage"
                  src="https://img.youtube.com/vi/FOODhMCWJsc/0.jpg"
                  alt
                />
              </div>

              <div class="carddata">
                <h5 class="title">Naslov</h5>

                <h6 class="author">Izvajalec</h6>
                <div class="views">1552 ogledov</div>
              </div>
            </div>
          </a>
        </div>
      </div>
    );
  }
}

export default Category_Item;
